import React, { useState } from "react"
import "./index.css"
 const App = ()=>{
     let [val,Set]=useState("")
     const Make =(e)=>{
       Set(e.target.value)
     }
     function build(){
    document.getElementById("m").append(val);
     }
     return (
         <>
        <div className="main">
            <div className="cnt">
                <h1>todo <span> list </span></h1>
                <br />
                <input type="text" placeholder="add a item" onChange={Make}/>
                <button onClick={build}>+</button>
                <ol id="m">
                    <li id="a"></li>
                </ol>
            </div>

        </div>

         </>
     )
 }



 export default App;
